  false,\n\t\"url\": null,\n\t\"notes\": \"CTD, current meter, meteorological buoy,
  and bottle data were collected from the Gulf of Mexico from the ALPHA HELIX and
  other platforms. Data were collected by Texas A&M University (TAMU) in support of
  LATEX A from 18 March 1993 to 23 September 1993. CTD parameters include temperature,
  salinity, and sigmat-t. Current meter parameters include E/W velocity (U), N/S velocity,
  temperature, and conductivity. Bottle data includes concentrations of dissolved
  oxygen, phosphate, nitrite, nitrate, silicate, ammonium, urea, chlorophyll-A, and
  suspended particulate material.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
